script: |
  super -f tsv -I q12850.sql | sort > q12850.out

vector: true

inputs:
  - name: q12850.sql
    data: |
      SELECT DISTINCT + 64 * - col2 AS col0 FROM tab1 WHERE col0 NOT BETWEEN 24 + + col0 AND - col2 * + col2;
  - name: tab1

outputs:
  - name: q12850.out
    data: |
      -3776
      -4352
      -6144
